import React from "react";
import VideoContainer from "../../components/VideoContainer";


function Room() {
  //console.log(props);
  const myVideo = {
    id: 0,
    name: "mine"
  }
  const peerVideos = [
    {
        id: 1,
        name: "SSam"
    },
    {
        id: 2,
        name: "SSong"
    }
  ];
  return (
    <div>
      <h1>OrchestLive!</h1>
      <div className="call">
        <h1>Room Name : </h1>
        <h3>Client : </h3>
        <VideoContainer l={peerVideos.length} streamArray={peerVideos} myStream={myVideo}>
          <Video id={myVideo.id} name={myVideo.name} autoPlay></Video>
          {
            peerVideos.map((id, name) => (
                <Video id={id} name={name} />
            ))
          }
        </VideoContainer>
        
        <button className="mute">Mute</button>
        <button className="camera">Turn Camera Off</button>
        <select className="cameras"/>
        <div>
          <button className="out">Remove</button>
        </div>
      </div>
    </div>
  );
  
  
}

export default Room;
